import React, {Component} from "react";

export default class FilterContainer extends Component
{
    render() {
        return (

            <div className = "filter-container" >
                <form>
                    <label>Gender</label>
                    <input type="checkbox" name="maleFilter" value="male"/>
                </form>
            </div>
        )
    }
}
